押しボタン式トイレをセンサー感知式へ。しかも、しっかり節水、きちんと節電。<br />●後付け式フラッシュマンのロングセラー「FM6シリーズ」が、節水機能、扱いやすさ、デザイン性を向上させリニューアル。旧式の主要なフラッシュバルブに後付けできます。<br />●効率的な洗浄でトイレにも地球にもやさしく。使用状況や頻度、未使用時間に応じて適切な水量を自動制御します。水の無駄を抑えながら、きちんとトイレの清潔を維持します。<br />●施工とメンテナンスのしやすさ。取り付けやすさを重視した構造なので、施工時間を大幅に短縮できます。扱いやすい単三アルカリ電池仕様で長時間動作します。<br />●便利な機能で人にやさしく。清掃時に便利な手動洗浄ボタンや水道管の凍結を防ぐ凍結防止機能、水道の使用制限時の渇水モード、電池交換時期通知など、便利な機能を搭載。<br />●気持ちよく使いたい。洗練されたデザインで、後付けでも新鮮なトイレ空間に。雰囲気に合せて、2色のカラーからお選びいただけます。<br />●後付けタイプ<br />●使用電源：単三アルカリ乾電池2本<br />●電池寿命：月4000回使用時(本洗浄のみ)で約3年<br />●洗浄：前洗浄の有無、本洗浄の吐水時間を設定可能。吐水量は使用状況により自動制御<br />●凍結防止機能：気温が3℃未満になると気温に応じて間欠吐水<br />●設備保護洗浄：最終使用から6時間と以後未使用24時間ごとに洗浄<br />●洗浄停止モード：手動ボタンを約3秒長押しで10分間センサ感知を停止<br />●渇水モード：手動ボタンを約8秒長押しで通常の半分の吐水量に変更<br />●外装：ABS樹脂/クロムメッキフランジ/ガラス製センサ窓<br />●センサ方式：赤外線反射方式<br />●適応圧力：最低水圧：0.05Mpa(流動時)/最高水圧：0.74Mpa<br />●使用温度範囲：周囲1～50℃/水温：1～40℃<br />●外径：74mm<br />●高さ：135mm<br />●製品保障期間3年間<br />●キャップナット同梱<br />1回のご購入合計金額(税込)が【5,400円以上】の場合は送料無料です。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。<br />1回のご購入合計金額(税込)が【5,400円未満】の場合は送料がかかります。<br />送料は全国一律540円(重量10kgまで)、沖縄県は10kgまで1,620円を申し受けます。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。●メーカー:ミナミサワ<br />●型式:FM6T-S<br />●カラー:シルバー<br />●用途:TOTO用<br />●適合するフラッシュマン品番:FM6T<br /><br />●出荷目安:5営業日以内<br><br>


